import {useState, useEffect} from 'react'

function Home(){
  const [list, setList] = useState([])

  useEffect(() => {
    fetch("http://localhost:5001/api")
    .then(response => response.json())
    .then(list => setList(list))
  })

  return(
    <>
      <div>
        {
          list.map(item => (
            <div>
              <h3>{item[1]}</h3>
              <p>{item[2]}</p>
              {
                () => {
                  const data = JSON.parse(item[4])
                  if (data != null){
                    return (
                      data.map(elem => (
                        <div>{elem}</div>
                      ))
                    )
                  }
                }
              }
            </div>
          ))
        }
      </div>
    </>
  )

}

export default Home;
